pragma solidity ^0.4.17;

import "./TimelineDocument.sol";

/**
 * Represents a location and SHA-256 hash of a document that shows proof
 * of something.
 *
 * Copyright (c) 2017 Cognate, Inc.
 */
contract ProofDocument is TimelineDocument {
    using ITimelineDocumentLib for ITimelineDocumentLib.ProofDocumentStorage;

    ITimelineDocumentLib.ProofDocumentStorage proofDocument;

    constructor(string location, bytes32 hash) public {

        proofDocument._location = location;
        proofDocument._hash = hash;
    }


    function setLocation(string location) public {
        proofDocument.setLocation(location);
    }


    // Getters
    //--------

    function location() public view returns (string) {
        return proofDocument._location;
    }

    function hash() public view returns (bytes32) {
        return proofDocument._hash;
    }
}
